import React from "react";
import Navigation from "../components/Navigation";

const Presentation = () => {
  return (
    <>
      <Navigation />
      <div className="col-xl">
        <h1 className="profile display-4 fw-bolder">À propos</h1>
        <div className="boxRec">
          <p>
            Plusieurs variations de Lorem Ipsum peuvent être trouvées ici ou là,
            mais la majeure partie d'entre elles a été altérée par l'addition
            d'humour ou de mots aléatoires qui ne ressemblent pas une seconde à
            du texte standard. Si vous voulez utiliser un passage du Lorem
            Ipsum, vous devez être sûr qu'il n'y a rien d'embarrassant caché
            dans le texte. Tous les générateurs de Lorem Ipsum sur Internet
            tendent à reproduire le même extrait sans fin, ce qui fait de
            lipsum.com le seul vrai générateur de Lorem Ipsum. Iil utilise un
            dictionnaire de plus de 200 mots latins, en combinaison de plusieurs
            structures de phrases, pour générer un Lorem Ipsum irréprochable. Le
            Lorem Ipsum ainsi obtenu ne contient aucune répétition, ni ne
            contient des mots farfelus, ou des touches d'humour.
          </p>
          <button className="btn btn-danger">TELECHARGER MON CV</button>
        </div>
      </div>
    </>
  );
};

export default Presentation;
